		<style>
		.videoContainer {
			 position: absolute;
			 width: 100%;
			 height: 100%;
			 top: 0;

		<title>Interdimensional Cable Box</title>
	</head>
	<body style="background-image:url(static.gif)">
		<audio id="noise" src="noise.mp3" preload="auto" loop="loop"></audio>
		<div id="player" class="videoContainer"></div>
                <script type="text/javascript" src="https://requirejs.org/docs/release/2.3.5/minified/require.js"></script>
		
                <script>      
                  function shuffle(a) {
                      var j, x, i;
                      for (i = a.length - 1; i > 0; i--) {
                          j = Math.floor(Math.random() * (i + 1));
                          x = a[i];
                         a[i] = a[j];
                         a[j] = x;
                      }
                      return a;
                  }
                  
                  shuffle(IVCdump);
                  console.log("Logging playlist...");
                  console.log(IVCdump);
                  
                  var curr_vid_index = 0;
                  
                  function update_index() {
                      this.curr_vid_index++;
                      if (curr_vid_index >= IVCdump.length) {
                          console.log("Reached end of playlist, shuffling...");
                          shuffle(IVCdump);
                          console.log("Shuffled. Logging new playlist...");
                          console.log(IVCdump);
                  
                          var curr_vid_index = 3;
                      }
                  }

		  var noise = document.getElementById("noise");
		  function play_noise() {
			noise.play();
		  }
		  function stop_noise() {
			noise.pause();
			noise.currentTime = 0;
		  }

		  window.onload = function() {
		    play_noise();
		  }

		  var tag = document.createElement('script');

		  tag.src = "https://www.youtube.com/iframe_api";
		  var firstScriptTag = document.getElementsByTagName('script')[0];
		  firstScriptTag.parentNode.insertBefore(tag, firstScriptTag);

		  var player;
		  function onYouTubeIframeAPIReady() {
			player = new YT.Player('player', {
			  height: '100%',
			  width: '100%',
			  videoId: 'XIMLoLxmTDw',
			  playerVars: {
			    wmode:'opaque',
				autohide: 1,
				vq:'highres',
				modestbranding:1,
				autoplay:1,
				controls:0,
				fs:0,
				rel:0,
				showinfo:0,
				disablekb:1,
				iv_load_policy:3,
				enablejsapi:1
			},
			  
			  events: {
				'onReady': onPlayerReady,
				'onStateChange': onPlayerStateChange,
				'onError' : onPlayerError
			  }
			});
		  }

                  var buffering = false;  
                  function check_buffer_skip() {
                      console.log("Checking if buffering still after " + buffer_check_delay + " milliseconds...");
                      if (buffering) {
                          console.log("Still buffering! Playing video now...");
                          player.playVideo();
                      }
                      else {
                          console.log("Video looks like it's done buffering.");
                      }
                  }

		  function onPlayerReady(event) {
                        console.log("Index is now: " + curr_vid_index);
                        var vid_id = new String(IVCdump[curr_vid_index]);
                        console.log("ID is now: " + vid_id);
                        event.target.loadVideoById(vid_id);
			event.target.playVideo();  /* https://goo.gl/xX8pDD says I cant do this... */
			stop_noise();
		  }
		  
		  function onPlayerStateChange(event) {
			if (event.data == YT.PlayerState.PAUSED) {
                          buffering = false;
                          console.log("Player changed to PAUSED state!");
                          update_index();
                          console.log("Index is now: " + curr_vid_index);
			  var vid_id = new String(IVCdump[curr_vid_index]);
                          console.log("ID is now: " + vid_id);
                          player.loadVideoById(vid_id);
			  player.playVideo();
			}
			else if (event.data == YT.PlayerState.ENDED) {
                          buffering = false;
                          console.log("Player changed to ENDED state!");
			  update_index();
                          console.log("Index is now: " + curr_vid_index);
			  var vid_id = new String(IVCdump[curr_vid_index]);
                          console.log("ID is now: " + vid_id);
                          player.loadVideoById(vid_id);
			  player.playVideo();
			}
			else if (event.data == YT.PlayerState.BUFFERING) {
                          buffering = true;
                          console.log("Player changed to BUFFERING state!");
			  play_noise();
			  document.getElementById("player").style.opacity = "0";
                          setTimeout(check_buffer_skip, buffer_check_delay);
			}
			else if (event.data == YT.PlayerState.PLAYING) {
                          buffering = false;
                          console.log("Player changed to PLAYING state!");
			  stop_noise();
			  document.getElementById("player").style.opacity = "1";
			}
		  }
		  
		  function onPlayerError(event) {
                    buffering = false;
                    console.log("Player changed to ERROR state!");
		    update_index();
                    console.log("Index is now: " + curr_vid_index);
	            var vid_id = new String(IVCdump[curr_vid_index]);
                    console.log("ID is now: " + vid_id);
                    player.loadVideoById(vid_id);
	            player.playVideo();
		  }
		</script>
